
#Export xCAD data
xcad.export.ExportRequestSubmitted= xCAD 데이터 내보내기 작업 제출됨

#Error messages 
XEError.FailedToInitializeContext= 컨텍스트를 초기화하지 못했습니다.
XEError.CannotReadJsonInputStream= JSON 입력 스트림을 읽을 수 없습니다.
XEError.InvalidInputJson= 올바르지 않은 입력 Json입니다.
XEError.MandAttrsMissing= 페이로드에 physicalid/type/cadmaster 속성 값이 없습니다.
XEError.MandCV5AttrsMissing= 페이로드에 루트, 데이터 속성 값이 없습니다.
XEError.MandDataAttrMissing= 페이로드에 데이터 속성 값이 없습니다.
XEError.SimilarExportDataJobExists= 유사한 데이터 내보내기 작업 요청이 있습니다.
XEError.FailedToSubmitRequest= 요청 제출 실패
XEError.UnableToRetreiveXDPServiceUrl= xcaddataprocessor 서비스 URL을 검색할 수 없음

#Following key and values are used in XCAD processor service as well. This should be always in sync for user messages consistency in 3D Notifications--START
XEError.UnsynchronizedStructure= <strong>###JobTitle###</strong> 내보내기에 실패했습니다. 구조가 동기화되지 않았습니다.
XEError.DifferentCADMasterInStructure= <strong>###JobTitle###</strong> 내보내기에 실패했습니다. 구조에서 다른 CAD 마스터 개체를 사용할 수 있습니다.
XEError.FailedToExpandWithIndexServer= <strong>###JobTitle###</strong> 내보내기에 실패했습니다. 인덱스 서버로 확장하지 못했습니다.
XEError.ExportObjectLimitExceeded= <strong>###JobTitle###</strong> 내보내기에 실패했습니다. 데이터 내보내기 개체 제한을 초과했습니다. 구조의 하위 집합으로 시도하십시오.
XEError.JobExecutionUnexpectedError= <strong>###JobTitle###</strong> 내보내기에 실패했습니다. 예기치 않은 오류가 발생했습니다.

#3D Notifications
xcad.export.notifications.successjob= 성공한 CAD 내보내기 작업에 대해 알림
xcad.export.notifications.failjob= 실패한 CAD 내보내기 작업에 대해 알림
xcad.export.notifications.job.msg= <strong>###JobTitle###</strong> 내보내기가 완료되었습니다. 내보내기 패키지를 보고 다운로드하려면 여기를 클릭하십시오.
xcad.export.notifications.job.failed.msg= <strong>###JobTitle###</strong> 내보내기에 실패했습니다. 세부사항을 보려면 여기를 클릭하십시오.
